import React, {useState} from 'react';
import Dark_logo from '../images/logo-dark-bg.svg';


function Header() {
  const [isActive, setActive] = useState("false");
  const ToggleClass = () => {
    setActive(!isActive); 
   };
    return (
      <header className="main_header">
        <div className="container-fluid">
        <div className="row align-items-center">
          <div className="col-md-3">
          <h2 className="logo"><img src={Dark_logo} alt="" /></h2>
             <span onClick={ToggleClass} className="menu_toggle">Toggle</span>
          </div>
          <div className="col-md-9 text-right">
            <ul className={"list-inline"+ isActive ? "active" : null}>
                <li className="list-inline-item active"><a href="#">How it works</a></li>
                <li className="list-inline-item"><a href="#">FAQ</a></li>
                <li className="list-inline-item"><a href="#">(416)984-4659</a></li>
            </ul>
          </div>
        </div>
        </div>
      </header>
    );  
  }
  
  export default Header;
